import React from 'react';
import styles from './Filters.module.scss';


const Gender = () => {
    return(
    <div className={`${styles.input}accordion`} id="GenderAccordion">
        <div className="accordion-item">
            <h2 className="accordion-header" id="headingGender">
            <button className="accordion-button" type="button" data-bs-toggle="collapse" data-bs-target="#collapseGender" aria-expanded="true" aria-controls="collapseGender">
                Gender
            </button>
            </h2>
            <div id="collapseGender" className="accordion-collapse collapse show" aria-labelledby="headingGender" data-bs-parent="#GenderAccordion">
                <div className="accordion-body">
                    {/* Gender filter options */}
                </div>
            </div>
        </div>
    </div>
    )
}

export default Gender;
